import React from 'react';
import Modal from './Modal';

class  Header extends React.Component {
    render() { 
        return ( 

            <header id="Header" class="grid header">
       <Modal>
{this.props.children}

       </Modal>
    

          </header>
         );
    }
}
 
export default Header;
